import React from 'react';
import { Link } from 'react-router-dom';


const Post = ({ postId, title, content }) => (
  <div className="post">
    <h2>{title}</h2>
    <p>{content}</p>
    <Link to={`/posts/${postId}`}>Read More</Link>
  </div>
);

export default Post;
